 na to, \u017ee zrovna vy jste na\u0161imi ambasadory. \n\nPremi\u00e9ra spotu ji\u017e dnes ve 20:00 na \u010cT1 v r\u00e1mci Festivalov\u00fdch minut. To nejlep\u0161\u00ed z Olympijsk\u00fdch her #TOKYO2020 a Olympijsk\u00fdch festival\u016f p\u0159in\u00e1\u0161\u00ed Eva Samkov\u00e1 (@eva_samkova )\n\n@choupenitch @barborastrycova \n#allianz #allianzpojistovna #kryjemevamzada #vevsemcovasceka #zivot #moment #TeamAllianz #AllianzAmbasador #AlexanderChoupenitch #fencing #serm #fleret #BaraStrycova #tenis #GivingConfidence #hrdypartner #olympijskytym @olympijskytym"}}]},"edge_media_to_comment":{"count":7},"comments_disabled":false,"taken_at_timestamp":1627141458,"edge_liked_by":{"count":631},"edge_media_preview_like":{"count":631},"location":null,"thumbnail_src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/223582859_547849129676181_568221368787645838_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=pguY-uQqHyUAX_jBdLg\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=f2ea94ff5fb5b161a687d16ab1d585b4\u0026oe=619B03E0\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/s150x150/223582859_547849129676181_568221368787645838_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=pguY-uQqHyUAX_jBdLg\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=bac3bba3b9c5a6ec84d9dc0f598cb6e2\u0026oe=619B34DE\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/s240x240/223582859_547849129676181_568221368787645838_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=pguY-uQqHyUAX_jBdLg\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=9abf169f8c077452427f6d56163ce559\u0026oe=619B7898\u0026_nc_sid=7bff83","config_width":240,"config_height":240},{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/s320x320/223582859_547849129676181_568221368787645838_n.jpg?_nc_ht=instagram.fudi2-1
